import React from "react";
import {
  Nav,
  NavItem
} from 'reactstrap';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';

const OrderPageHeader = () => {

  const HeaderRootStyle  = styled.div`
  background:#DC143C;
  height:20vh;
`
  const main =styled.div`
  width: 60vw;  
height: 100vh;
margin: auto;
display: flex;
flex-direction: column;
align-items: center;  
  `

return (
<HeaderRootStyle>
  <Nav>
    <NavItem>
      <NavLink to="/">Anasayfa</NavLink>
    </NavItem>
    <NavItem>
      <NavLink href="#">Seçenekler</NavLink>
    </NavItem>
    <NavItem>
      <NavLink disabled href="#">Sipariş Oluştur</NavLink>
    </NavItem>
  </Nav>
</HeaderRootStyle>


)
}

export default OrderPageHeader;
